(1, 1, 'Visi dan Misi', '<p><strong>Visi Kejaksaan R.I :</strong></p><ul></ul><p>Kejaksaan sebagai lembaga penegak hukum yang bersih, efektif, efisien, transparan, akuntabel, untuk dapat memberikan pelayanan prima dalam mewujudkan supremasi hukum secara profesional, proporsional dan bermartabat yang berlandaskan keadilan, kebenaran, serta nilai â€“ nilai kepautan.</p><p><strong>Misi Kejaksaan R.I :</strong></p><ul></ul><ol><li>Mengoptimalkan pelaksanaan fungsi Kejaksaan dalam pelaksanaa tugas dan wewenang, baik dalam segi kualitas maupun kuantitas penanganan perkara seluruh tindak pidana, penanganan perkara Perdata dan Tata Usaha Negara, serta pengoptimalan kegiatan Intelijen Kejaksaan, secara profesional, proposional dan bermartabat melalui penerapan Standard Operating Procedure (SOP) yang tepat, cermat, terarah, efektif, dan efisien.</li><li>Mengoptimalkan peranan bidang Pembinaan dan Pengawasan dalam rangka mendukung pelaksanaan tugas bidang-bidang lainnya, terutama terkait dengan upaya penegakan hukum.</li><li>Mengoptimalkan tugas pelayanan publik di bidang hukum dengan penuh tanggung jawab, taat azas, efektif dan efisien, serta penghargaan terhadap hak-hak publik;</li><li>Melaksanakan pembenahan dan penataan kembali struktur organisasi Kejaksaan, pembenahan sistem informasi manajemen terutama pengimplementasian program quickwins agar dapat segera diakses oleh masyarakat, penyusunan cetak biru (blue print) pembangunan sumber daya manusia Kejaksaan jangka menengah dan jangka panjangtahun 2025, menerbitkan dan menata kembali manajemen administrasi keuangan, peningkatan sarana dan prasarana, serta peningkatan kesejahteraan pegawai melalui tunjangan kinerja atau remunerasi, agar kinerja Kejaksaan dapat berjalan lebih efektif, efisien, transparan, akuntabel dan optimal.</li><li>Membentuk aparat Kejaksaan yang handal, tangguh, profesional, bermoral dan beretika guna menunjang kelancaran pelaksanaan tugas pokok, fungsi dan wewenang, terutama dalam upaya penegakan hukum yang berkeadilan serta tugas-tugas lainnya yang terkait.</li></ol><p>(Sumber: Peraturan Jaksa Agung No: 011/A/JA/01/2010 tentang Rencana Strategis Kejaksaan Republik Indonesia Tahun 2010-2014 tanggal 28 Januari 2010)</p>', 'published', 'pembinaan', '2015-01-21 04:47:22', '2015-01-21 18:08:14', NULL),
