(5, 1, 'Tri Krama Adyaksa', '<p style="text-align: center;">\r\n	<img width="300px" src="/images/logo-kejari.jpg">\r\n</p>\r\n<p>\r\n	<b>Tri Krama Adhyaksa</b>, adalah doktrin Kejaksaan Indonesia:\r\n</p>\r\n<ol>\r\n	<li><b>Satya</b>, yang artinya kesetiaan yang bersumber pada rasa jujur, baik terhadap Tuhan Yang Maha Esa, terhadap diri pribadi dan keluarga maupun kepada sesama manusia.</li>\r\n	<li><b>Adhi</b>, yang artinya kesempurnaan dalam bertugas dan berunsur utama pemilikan rasa tanggung jawab bertanggung jawab baik terhadap Tuhan Yang Maha Esa, terhadap keluarga dan terhadap sesama manusia.</li>\r\n	<li><b>Wicaksana</b>, yang artinya bijaksana dalam tutur kata dan tingkah laku khususnya dalam pengetrapan kekuasaan dan kewenangannya.</li>\r\n</ol>', 'published', 'pembinaan', '2015-01-21 04:47:22', '2015-01-21 18:46:56', NULL),
(6, 1, 'Placeat quo quasi et.', 'Sit dolorum et dolorum quia quod. Rerum reiciendis sed voluptas omnis corrupti et hic natus. Blanditiis omnis placeat voluptates architecto. Quo laudantium nisi labore voluptatibus molestiae itaque. Repudiandae dolores ea aut assumenda quia. Consectetur perspiciatis fugit aliquam cumque possimus quis voluptatem. Architecto vel similique autem et. Consequatur aspernatur vero et culpa quod. Aut repellat reiciendis aspernatur debitis. Ut facilis dolore voluptatem sed ea ipsum eius. Odit eius deserunt pariatur vitae voluptatem et. Qui sint esse voluptas natus incidunt non. Magni corporis corrupti quia et dolorem.', 'published', 'intelijen', '2015-01-21 04:47:22', '2015-01-21 04:47:22', NULL),
